function Task(taskobject) {
    const task=taskobject.task;



    
    return(
        <div>
        <h5>{task.taskname}</h5> 
        {task.completion && <h6 className='completed'>Completed</h6>}
        {!(task.completion) && <h6 className='notcompleted'>Not complete</h6>}



        </div>
    );
}

export default Task;
